import React from "react";
import SelectedDetails from "../Context/SelectedDetails";

const PlanPage = () => {
  const { period } = SelectedDetails();
  return (
    <div className="container">
      <div className="box flexCol">
        <div>
          <div className="heading bold large">Current Plan Details</div>
          <span></span>
        </div>
        <div className="regular">Basic</div>
        <div className="opac">{period}</div>
      </div>
    </div>
  );
};

export default PlanPage;
